import React from 'react';
import './createWorkout.scss'
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import { Button } from '@material-ui/core';

function CreateWorkout(props) {
    return (
        <div className="createWorkout">
            <div className="createWorkout__input">
                <div className="createWorkout__input-workout">
            
                    <TextField
                        id="filled-basic"
                        label="Name Workout"
                        variant="filled"
                    // defaultValue={exercise.exerciseName}
                    />
                </div>

                <FormControl variant="filled" className="createWorkout__input-exercise">
                    <TextField

                        id="filled-select-currency-native"
                        select
                        label="Select Exercise"
                        // value={currency}
                        // onChange={handleChange}
                        // SelectProps={{
                        //     native: true,
                        // }}
                        variant="filled" >

                        {/* {
                        currencies.map((option) => (
                            <option key={option.value} value={option.value}>
                            {option.label}
                            </option>
                            ))
                        } */}
                    </TextField>
                </FormControl>
            </div>

        </div>
    );
}

export default CreateWorkout;
